(43960, '0A3F4CFF-66E9-4450-BF13-0569CF8BCFD8', 'Love, I’m sorry that I can’t engage with you vulnerably face to face. I recognize  a huge wall of defensiveness covering deep feelings of shame and some fear. I own that I was projecting my feelings of being judged as selfish on to you. You were not being selfish asking me to try and find a path for us to have a meaningful Passover experience and have a Seder with my family. You were doing what you should do. I’m sorry that what I said and how I acted was painful. That is the absolutely last thing in the world I want to do. And the reason I am so defended is that there is a part of me that can’t stand disappointing you and can’t stand seeing that I hurt you …and he also can’t stand being judged by my family as being a bad son and brother. I realize that this is not the adult me. The adult me sent the note to my mom and sister like you had recommended. And the adult me wants to hold you and  support you as you go through the pain that I caused. It’s very very hard for me to face that pain and not lose myself. I’m accountable and I’m sorry. I take back my projections and own am here for you. ', 'David', 'Nitzan', '2022-02-25T07:33:09.036268'),
