(44079, '73232E1F-A4BE-430A-932D-81978E1644FF', 'Love , I’m feeling out of sorts and shitty about last night and the last week. I’m sorry for overreacting last night and not catching myself and re-directing my feelings in a more constructive, and collaborative and playful way. I know there is work for me to do…and it’s territory that feels tricky and well defended. I don’t think it is really about me not giving you the benefit of the doubt…that somehow doesn’t feel right to me, but I hear that this is how it lands to you, and that this feels infuriating. I know that you are on my team, that you are incredibly capable, and that ultimately…these reactions aren’t about you, they are mostly my own projections. I feel deeply frustrated with myself for not being able to be better at self-regulating in these moments. It actually feels really deflating. But, I’ll keep at it and am committed.  ', 'David', 'Nitzan', '2022-02-26T11:08:25.375563'),
