(44371, '034C8F34-D84F-4294-8150-6C6BDBFA45A8', '@channel friends and community, I️ am writing with a heavy heart tonight to share that a beloved Climber from Salesforce cohort 2, @Abdul Sultani, is suffering with 3 cancerous tumors in his brain. He’s lost much of his vision over the last few days. He has an important surgery this upcoming Thursday where they will remove the tumor affecting his vision. Abdul came to us about a year and a half ago working at Jack in the box during the day and driving Uber at night. He has since gone on to launch an incredibly successful career at Gusto. He served as a Fellow for cohort 3 and participated in leading basecamp on the weekends for many in our community. Abdul comes from Afghanistan and helped many of his family members escape to Pakistan earlier this year as the Taliban were coming to take over the country. He has a heart of gold. If you know Abdul, PLEASE reach out and show him your love. He could use our community’s affection and grace right now. Our hearts and prayers are with you Abdul.', 'Nitzan', 'David', '2022-02-28T11:09:50.412110'),
